    return(
        <><BrowserRouter>
        <Menu/>
            <Routes>
                <Route path='/' element={<Home name='Kandarp' number='24'/>}></Route>
                <Route path='/about' element={<About/>}></Route>
                <Route path='/contact' element={<Contact fun={contactinfo} />}></Route>
                <Route path='*' element={<Error/>}></Route>
            </Routes>
        </BrowserRouter>
        </>
    );
};
